  <form [formGroup]="loginForm" class="auth--form auth-body">
    <div class="auth-body--header auth-header">
      <p class="auth-header--title">Sign In</p>
      <div class="auth-header--body">
        <span class="auth-header--text" >
          New user to RASP?
        </span>
        <span>
          <a class="navigator" href="#" >Sign up</a>
        </span>
      </div>
    </div>
    <div class="auth-body--logo">
      <div class="auth-body--inputs" id="1">
          <mat-form-field class="auth-body--field" appearance="outline">
            <input type="email" matInput formControlName="emailFormControl" placeholder="Email">

          </mat-form-field>
          <mat-form-field class="auth-body--field" appearance="outline">
            <input matInput [type]="hide ? 'password' : 'text'" formControlName="passwordFormControl" class="input" placeholder="Password">
            <span mat-icon-button matSuffix (click)="hide = !hide" [attr.aria-label]="'Hide password'" [attr.aria-pressed]="hide">
              <mat-icon>{{hide ? 'visibility_off' : 'visibility'}}</mat-icon>
            </span>
          </mat-form-field>
        <span class="auth-body--text">
          <a routerLink="#" class="navigator" >
            Forgot your password?
          </a>
        </span>
      </div>
      <div class="auth-body--formbuttons">
        <span mat-button class="auth-body--sign" >Sign in</span>
      </div>
    </div>
  </form>
